var aesCryptography = {
  getBytes: function(base64String) {
    return CryptoJS.enc.Base64.parse(base64String);
  },
  getBase64String:function(byteArray){
    return CryptoJS.enc.Base64.stringify(byteArray);
  },
  generateRandomIvBytes: function() {
    return CryptoJS.lib.WordArray.random(16);
  },
  generateRandomAesKeyBytes: function() {
    return CryptoJS.lib.WordArray.random(32);
  },
  encrypt: function(aesKeyBytes,ivBytes,plainText) {
    var encryptedBytes = CryptoJS.AES.encrypt(plainText, aesKeyBytes, {iv: ivBytes, mode: CryptoJS.mode.CBC, padding: CryptoJS.pad.Pkcs7});
    return encryptedBytes.toString();
  },
  decrypt: function(aesKeyBytes,ivBytes,cipherTextBase64) {
    var decrypt = CryptoJS.AES.decrypt(cipherTextBase64, aesKeyBytes, {iv: ivBytes, mode: CryptoJS.mode.CBC, padding: CryptoJS.pad.Pkcs7});
    var plaintext = decrypt.toString(CryptoJS.enc.Utf8);
    return plaintext;
  }
};

var RSACryptography = {
  encryptRsa: function(rsaPublicKeyBase64String,plainText) {
    var RSACrypto = new JSEncrypt();
    RSACrypto.setPublicKey(rsaPublicKeyBase64String);
    var encryptedBytes = RSACrypto.encrypt(plainText);
    return encryptedBytes.toString();
  },
};

function Config (app, rsaPublicKey, url) {
    this.app = app;
    this.rsaPublicKey = rsaPublicKey;
    this.url = url;
}

function RedPayCardProcessor(config) {
  var config = config;

  this.Charge = function({
    amount=0,
    account,
    currency="USD",
    expmmyyyy,
    cvv,
    signatureData,
    cardHolderName,
    method="CNP",
    authCode,
    retryCount,
    track1Data,
    track2Data,
    avsAddress1,
    avsAddress2,
    avsCity,
    avsZip,
    cardHolderEmail,
    cardHolderPhone,
    employeeRefNum,
    customerRefNum,
    orderRefNum,
    terminalRefNum
  }) {

    var args = arguments[0];

    var randomAesKeyBase64String = aesCryptography.getBase64String(aesCryptography.generateRandomAesKeyBytes());

    var rsaPublicKey = config.rsaPublicKey;
    //"";
    var rsaCipherText = RSACryptography.encryptRsa(rsaPublicKey,randomAesKeyBase64String);

    var requestPacket1 = {
      rsaPublicKey: rsaPublicKey,
      aesKey: rsaCipherText
    };
    //console.log("encryptedRsa", encryptedRsa);

    return Post(requestPacket1).then(function(responsePacket1) {

      //console.log("responsePacket1", responsePacket1);
      if (responsePacket1 == null) {
        return null;
      }

      var sessionId = responsePacket1.sessionId;

      // Pass in the packet
      var RedPayRequest = args;
      RedPayRequest.action = "A";
      //console.log("RedPayRequest", RedPayRequest);

      var randomIVBase64String = aesCryptography.getBase64String(aesCryptography.generateRandomIvBytes());
      var aesPlainText = JSON.stringify(RedPayRequest);

      var aesCipherText = aesCryptography.encrypt(aesCryptography.getBytes(randomAesKeyBase64String),aesCryptography.getBytes(randomIVBase64String),aesPlainText);
      var requestPacket2 = new Packet(sessionId, config.app, aesCipherText, randomIVBase64String);
      //console.log("requestPacket2", requestPacket2);

      console.log("Sending packet...");

      return Post(requestPacket2).then(function(responsePacket2) {
        //console.log("responsePacket2", responsePacket2);
        if (responsePacket2 == null) {
          return null;
        }

        var RedPayResponse = aesCryptography.decrypt(aesCryptography.getBytes(randomAesKeyBase64String),aesCryptography.getBytes(responsePacket2.iv),responsePacket2.aesData);
        RedPayResponse = JSON.parse(RedPayResponse);
        return RedPayResponse;
      });
    });
  }

  function Packet(sessionId, app, aesData, iv) {
    this.sessionId = sessionId;
    this.app = app;
    this.aesData = aesData;
    this.iv = iv;
  }

  function Post(packet) {

    return $.ajax({
      url: config.url,
      data: packet,
      method: "post",
      dataType: "json",
      error: function(){
          // called when timeout is reached
          console.log("Session timed out");
          return null;
      },
      success: function(response){
          //do something
          return response;
      },
      timeout: 40000 // sets timeout to 40 seconds
    })

  }
}
